import React from 'react';

const Footer = () => {
    return(
        <div className='footer'>
            <section style={{textAlign: 'left'}}>
            <h3 style={{paddingBottom: '3rem'}}>Dylan Collins</h3>
            <p>Copyright {'\u00a9'} 2020 Dylan Collins. All rights reserved.</p>
            <p style={{fontSize: '.8rem', color: '#BEBEBE'}}>Coded by Dylan Collins, designed by <a style={{color: 'blue', textDecoration: 'underline'}} href='#'>Marc Dandoy</a></p>
            </section>
            <section>
                <h5>Follow</h5>
            </section>
            <section>
                <h5>More</h5>
            </section>
        </div>
    )
}

export default Footer;
